import "./Timetable.css";

export default function Timetable(props) {
  return (
  <>
<div className="timetable">
<div className="top-tt">
  <div>Day</div>
  <div>Monday</div>
  <div>Tuesday</div>
  <div>Wednesday</div>
   <div>Thursday</div>
    <div>Friday</div>
     <div>Saturday</div>










</div>


</div>



  </>
      
  );
}
